//verify data is in the table

spark.sql("select * from gdeltevents limit 2").show
spark.sql("SELECT GlobalEventID,SQLDate,Actor1Code, Actor1Name, Actor1CountryCode,Actor1KnownGroupCode,Actor1EthnicCode,Actor1Type1Code from gdeltevents where GlobalEventID=741011938").show

//identify top event types where selected country is involved

spark.sql("""select eventcode, count(eventcode) as cnt, ((count(eventcode))/(select count(globaleventID) from gdeltsmall where Actor1CountryCode='CHL'))*100 as percent 
frommd gdeltsmall where Actor1CountryCode='CHL' group by eventcode order by cnt DESC""").show(5,false)

//check how many bad events involving the 6 countries as secondary actor using the larger dataset

spark.sql("""select actor2countrycode, count(globaleventID) as Num_bad_events from gdeltevents where eventrootcode in ('13','14','15','16','17','18','19','20') and 
actor2countrycode in ('PHL','CHL','GRC','MUS','MEX','SEN') group by actor2countrycode order by Num_bad_events desc""").show

//did bad events take place in the 6 countries

spark.sql("""select actor1geo_countrycode, count(globaleventID) as Num_bad_events from gdeltevents where eventrootcode in ('13','14','15','16','17','18','19','20') and
actor1geo_countrycode in ('RP','CI','GR','MP','MX','SG') group by actor1geo_countrycode order by Num_bad_events desc""").show

//top 5 and bottom 5 other countries involved in the events by count

spark.sql("select actor1countrycode, actor2countrycode, count(*) as cnt from gdeltsmall where actor1countrycode='GRC' and actor2countrycode is not null group by actor1countrycode, actor2countrycode order by cnt desc").show(5,false)
spark.sql("select actor1countrycode, actor2countrycode, count(*) as cnt from gdeltsmall where actor1countrycode='GRC' and actor2countrycode is not null group by actor1countrycode, actor2countrycode order by cnt").show(5,false)

//avg tone in descending order

spark.sql("""select SQLdate, Actor1CountryCode, Actor2CountryCode, EventCode, QuadClass, GoldsteinScale, Nummentions, ActionGeo_CountryCode, SourceURL, avgtone 
from gdeltsmall where actor1countrycode='PHL' order by avgtone desc""").show(5,false)

//avg tone in ascending order

spark.sql("""select SQLdate, Actor1CountryCode, Actor2CountryCode, EventCode, QuadClass, GoldsteinScale, Nummentions, ActionGeo_CountryCode, SourceURL, avgtone 
from gdeltsmall where actor1countrycode='GRC' order by avgtone""").show(5,false)
